import { Grid, GridItem, Image } from '@chakra-ui/react'
import React from 'react'
import { useEffect } from 'react'
import { useState } from 'react'

export const QuickBuy = () => {
    const [data , setData]= useState([])

    const getData =()=>
    {
        fetch(" http://localhost:8000/QuickBuyData")
        .then((res)=>res.json())
        .then((data)=>
        {
            setData(data)
            console.log(data)
        })
    }
    useEffect(()=>
    {
        getData()
    },[])
  return (
    <div>
         <Grid templateColumns='repeat(5, 1fr)' gap={4} border="1px solid black" >
            {
                data.map((elem)=>
                (
                     <GridItem>
                       <Image src={elem.img} />
                       {elem.title}
                       {elem.price}
                        </GridItem>
                ))
            }

         </Grid>
         
         

    </div>
  )
}
